import React from "react";
import './contact.css';
import imageProfil from './image/Photo1.jpg';

const Contact = ({ nom }) => {
  return (
    <div className="image">
      <img src={imageProfil} alt={`Profil de ${nom}`} />
    </div>
  )
};

export default Contact;
